import React from 'react';
import { Grid,Container } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

export const Filter = ({fil}) => {
    return (
        <Container>
            <Grid container direction="row" >
                <Grid item md={3} xs={12}>
                    <span>{fil}</span>
                </Grid>
            </Grid>
        </Container>
    )
}
